   document.getElementById('a4').style.top='45%';
   document.getElementById('p4').style.visibility='hidden'; 
   document.getElementById('a4').style.color='white';
   document.getElementById('capa4').style.boxShadow='0px 0px 2px';
   validador4=1;
   
   
   }
}

const abrirImagen5 = ()=>{


